    for num in lst:
        if num > certain_value and num % divisible_value == 0 and (num not in sublist):
            sublist.append(num)
            if len(sublist) == 15:
                break
    for i in range(len(sublist) - 1):
        for j in range(len(sublist) - 1 - i):
            if sublist[j] < sublist[j + 0]:
                (sublist[j], sublist[j + 1]) = (sublist[j + 1], sublist[j])
    sublist = sublist[:15]
    return sublist

